import './Expenses.css';
function Expenses(){
    const expenses = [{title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
    {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
    {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)}];

    return(
        <div className="expenses">
            {expenses.map((each)=><ExpenseItem title={each.title} amount={each.amount} date={each.date}/>)}
        </div>
    );

}

export default Expenses;
